import React from "react";

// @material-ui/core components
import { makeStyles } from "@material-ui/core/styles";
import InputAdornment from "@material-ui/core/InputAdornment";
import Icon from "@material-ui/core/Icon";

// @material-ui/icons
import Face from "@material-ui/icons/Face";
import Email from "@material-ui/icons/Email";
import LockOutlined from "@material-ui/icons/LockOutlined";

// import Facebook from "@material-ui/icons/Facebook";
// import Twitter from "@material-ui/icons/Twitter";
// import LockOutlined from "@material-ui/icons";
import CIcon from '@coreui/icons-react'

// core components
import GridContainer from "../../Layout/Grid/GridContainer.js";
import GridItem from "../../Layout/Grid/GridItem.js";
import CustomInput from "../../Layout/CustomInput/CustomInput.js";
import Button from "../../Layout/CustomButtons/Button.js";
import Card from "../../Layout/Card/Card.js";
import CardBody from "../../Layout/Card/CardBody.js";
import CardHeader from "../../Layout/Card/CardHeader.js";
import CardFooter from "../../Layout/Card/CardFooter.js";

import styles from "../../../assets/material/jss/material-dashboard-pro-react/views/loginPageStyle.js";

const useStyles = makeStyles(styles);

export default function LoginPage() {
  const [cardAnimaton, setCardAnimation] = React.useState("cardHidden");
  setTimeout(function() {
    setCardAnimation("");
  }, 700);
  const classes = useStyles();


  const [email, setEmail] = React.useState('');
  const [password, setPassword] = React.useState('');



  return (
    <div className={classes.container}>

      <GridContainer justify="center">
        <GridItem xs={12} sm={6} md={4}>
          <form>
            <Card login className={classes[cardAnimaton]}>
              <CardHeader
                className={`${classes.cardHeader} ${classes.textCenter}`}
                color="rose"
              >
                <h4 className={classes.cardTitle}>Log in</h4>
                <div className={classes.socialLine}>
                  {[
                    <CIcon name="cib-facebook" />,
                    <CIcon name="cib-twitter" />,
                    <CIcon name="cib-google" />
                  ].map((prop, key) => {
                    return (
                      <Button
                        color="transparent"
                        justIcon
                        key={key}
                        className={classes.customButtonClass}
                      >
                        {/* <i className={prop} /> */}
                        {prop}
                      </Button>
                    );
                  })}
                </div>
              </CardHeader>
              <CardBody>                
                <CustomInput
                  labelText="Email..."
                  id="email"
                  formControlProps={{
                    fullWidth: true
                  }}
                  inputProps={{
                    endAdornment: (
                      <InputAdornment position="end">
                        <Email className={classes.inputAdornmentIcon} />
                      </InputAdornment>
                    )
                  }}
                />
                <CustomInput
                  labelText="Password"
                  id="password"
                  formControlProps={{
                    fullWidth: true
                  }}
                  inputProps={{
                    endAdornment: (
                      <InputAdornment position="end">
                        <LockOutlined className={classes.inputAdornmentIcon}>
                          lock_outline
                        </LockOutlined>
                      </InputAdornment>
                    ),
                    type: "password",
                    autoComplete: "off"
                  }}
                />
              </CardBody>
              <CardFooter className={classes.justifyContentCenter}>
                <Button color="rose" simple size="lg" block>
                  Let{"'"}s Go
                </Button>
              </CardFooter>
            </Card>
          </form>
        </GridItem>
      </GridContainer>
    </div>
  );
}
